import React from 'react';
import { Gal } from './components/Gal';
import './App.css';
import { BrowserRouter as Router,Switch ,Route,Link} from "react-router-dom"


function App() {
  return (
    <div>
<Gal>
<Router>
      <Switch>
        <Route path= '/' compontent ={Employee} exact><Employee/></Route>

      </Switch>
     </Router>
</Gal>
    </div>
  );
}

export default App;
